import { Component } from '@angular/core';
import { InventarioService } from 'src/app/servicios/Inventario/inventario.service';

@Component({
  selector: 'app-informacion',
  templateUrl: './informacion.component.html',
  styleUrls: ['./informacion.component.css']
})
export class InformacionComponent {

  constructor(private servicio:InventarioService){}
}

<div class="col-md-6 offset-md-3">
    <form #form="ngForm">
        <div class="form-group">
            <h1>Codigo</h1>
            <input type="text" class="form-control" name="codigo" ngModel>
        </div>
        <button type="submit" class="btn">Informacion</button>
    </form>
</div>
